import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, NavDropdown, Modal, Button, Form } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import '../../css/user/Usuarios.css';

function UserInsert() {
    const [showModal, setShowModal] = useState(false);
    const [newUser, setNewUser] = useState({
        nombre: '',
        correo: '',
        contrasena: ''
    });

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setNewUser({
            ...newUser,
            [name]: value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch('http://localhost:8000/crear_usuario', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(newUser)
            });

            if (!response.ok) {
                throw new Error('Error en la solicitud');
            }

            const data = await response.json();
            console.log('Respuesta de la API:', data);
            setShowModal(false); // Cerrar el modal después de enviar los datos
        } catch (error) {
            console.error('Error al enviar los datos:', error);
        }
    };

    return (
        <div className="app">
            <Navbar bg="white" expand="lg" fixed="top">
                <Nav className="ml-auto">
                    <NavDropdown title={
                        <svg xmlns="http://www.w3.org/2000/svg" width="54" height="54" fill="currentColor" className="bi bi-person-circle" viewBox="0 0 16 16">
                            <path d="M11 6a3 3 0 1 1-6 0 3 3 0 0 1 6 0" />
                            <path fillRule="evenodd" d="M0 8a8 8 0 1 1 16 0A8 8 0 0 1 0 8m8-7a7 7 0 0 0-5.468 11.37C3.242 11.226 4.805 10 8 10s4.757 1.225 5.468 2.37A7 7 0 0 0 8 1" />
                        </svg>
                    } id="user-menu" alignRight className="ml-auto">
                        <NavDropdown.Item as={Link} to="/menu">Menu</NavDropdown.Item>
                        <NavDropdown.Divider />
                        <NavDropdown.Item as={Link} to="/">Cerrar sesión</NavDropdown.Item>
                    </NavDropdown>
                </Nav>
            </Navbar>

            <div className="container mt-5 pt-5">
                <Button variant="primary" onClick={() => setShowModal(true)}>
                    Insertar nuevo usuario
                </Button>

                <Modal show={showModal} onHide={() => setShowModal(false)}>
                    <Modal.Header closeButton>
                        <Modal.Title>Insertar nuevo usuario</Modal.Title>
                    </Modal.Header>
                    <Modal.Body>
                        <div className="px-5 py-4">
                            <div className="d-flex align-items-center justify-content-center text-center">
                                <p className="fs-1"><b>Ingresar una nueva carrera</b></p>
                            </div>
                        </div>

                        <Form onSubmit={handleSubmit} id="insertForm">
                            <div id="form-container" className="d-flex justify-content-center flex-column px-5 py-4">
                                <div id="form-container-input" className="d-flex flex-column align-items-center">
                                    <div className="form-group d-flex py-2 w-100 justify-content-center">
                                        <Form.Control 
                                            type="text" 
                                            id="nombre" 
                                            name="nombre" 
                                            className="fs-2 border-bottom-only no-rounded" 
                                            placeholder="Nombre" 
                                            value={newUser.nombre} 
                                            onChange={handleInputChange} 
                                            required 
                                        />
                                    </div>
                                    <div className="form-group d-flex py-2 w-100 justify-content-center">
                                        <Form.Control 
                                            type="email" 
                                            id="correo" 
                                            name="correo" 
                                            className="fs-2 border-bottom-only no-rounded" 
                                            placeholder="Correo" 
                                            value={newUser.correo} 
                                            onChange={handleInputChange} 
                                            required 
                                        />
                                    </div>
                                    <div className="form-group d-flex py-2 w-100 justify-content-center">
                                        <Form.Control 
                                            type="password" 
                                            id="contrasena" 
                                            name="contrasena" 
                                            className="fs-2 border-bottom-only no-rounded" 
                                            placeholder="Contraseña" 
                                            value={newUser.contrasena} 
                                            onChange={handleInputChange}
                                            required
                                        />
                                    </div>
                                </div>
                            </div>
                        </Form>
                    </Modal.Body>
                    <Modal.Footer>
                        <Button variant="secondary" onClick={() => setShowModal(false)}>
                            Cancelar
                        </Button>
                        <Button variant="primary" type="submit" form="insertForm">
                            Guardar
                        </Button>
                    </Modal.Footer>
                </Modal>
            </div>
        </div>
    );
}

export default UserInsert;
